import React, { lazy } from 'react';
import { Navigate } from "react-router-dom";

let PublicRoute = [
  { path: "/home",exact:true,element :  lazy(() => import("../Pages/Home/Home"))}
]

let PrivateRoute = [
  { path: "/",exact:true, element : () => <Navigate replace to={"/login"} />},
  { path: "*",exact:false,element : () => <Navigate replace to={"/login"} />},
  { path: "/login",exact:true,element : lazy(() => import("../Pages/Login/Login"))},

]

export {PublicRoute , PrivateRoute}
